import { useEffect } from "react";
import { bindActionCreators } from "redux";
import { connect } from "react-redux";
import { makeStyles } from "@material-ui/styles";

import Layout from "../components/layouts/Layout";
import { getPostCode } from "../reducers/postsinfo";

import ActionMyBar from "../components/component/ActionMyBar";

// import { set_loading } from "../../reducers/utilsinfo";

const useStyles = makeStyles(theme => ({
  root: {
    minHeight: "calc(100vh)",
    backgroundColor: "rgb(240 240 240)"
  }
}));
const Index = props => {
  const classes = useStyles();
  useEffect(() => {}, []);
  const MyPage = (
    <div className={classes.root}>
      <ActionMyBar homeEnable={false} title="포스트" />
    </div>
  );

  return <Layout cookies={props.cookies} content={MyPage} />;
};

const mapStateToProps = state => {
  return { selectedPost: state.postsinfo.selectedPost };
};
const mapDispatchToProps = dispatch =>
  bindActionCreators({ getPostCode }, dispatch);

export default connect(mapStateToProps, mapDispatchToProps)(Index);
